(56, 'Kinkarso Teacher Test Class', '<p>Officially formed in late 2007, Kinkarso Tech Ltd. has had a history far beyond that. Since 2004, the Kinkarso brand has been putting together creative websites inspiring entrepreneurs, and leading innoative thinking on the WWW. </p><p>Kinkarso Tech offers a vast array of web related services that can help you build or improve your business. We are looking to work with you! The following is a list of services we offer to outside clients: </p><ul><li>Website Brokerage (No Domains)</li><li>Web Design &amp; Development</li><li>Creative Internet Marketing</li><li>Search Engine Optimization</li><li>Business Startup Consultation</li><li>Joint Venture Partnerships</li></ul><p>Want to speak with us directly concerning your project, or just want to tell us your thoughts on our websites? Whatever the reason may be, we would love to hear from you! Please use the appropriate email address below.</p><p>Interested in our services? Please contact us with as much information as possible, and we''ll get back to you within 1-2 business days.<br />                         <strong>Email: services[at]kinkarso.com</strong></p>                         <p>Please get in touch with Donny directly at..<br />                         <strong>Email: heydonny[at]kinkarso.com<br />Phone: +1.604-220-2979</strong></p><p>And for everything else..<br />                         <strong>company[at]kinkarso.com</strong>&nbsp; </p>', 77, '2009-12-06 22:16:37', '2009-12-06 22:16:37'),
