INSERT INTO `experts_promo_text` (`id`, `exp_id`, `content`) VALUES
(1, 235, '<p>testing ewrwer fgdfgdfg</p>\r\n<br />'),
(2, 454, '<p><span style="color: rgb(255, 102, 0);"><strong>Am here to do something!!!&nbsp; <br />\r\n</strong></span></p>'),
(3, 1088, '<p>awefawefawef <strong>awefawefawefawef</strong> waefawefawef</p>\r\n<p>&nbsp;</p>\r\n<p><u>wefawefwaef </u></p>\r\n<p>&nbsp;</p>\r\n<p><u><img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/confused.png" alt="" /></u></p>'),
(4, 1106, '<p>Mark Elliot &quot;Zuck&quot; Zuckerberg (born May 14, 1984) is an American entrepreneur who co-founded the social networking site Facebook. Zuckerberg co-founded Facebook with fellow classmates Dustin Moskovitz, Eduardo Saverin, and Chris Hughes while attending Harvard. He is a billionaire due to his 24% share of Facebook.</p>'),
(5, 1293, '<p>123456789</p>'),
(6, 1411, '<p>Presidential Intern</p>'),
(7, 812, '<p><span style="color: rgb(255, 0, 0);"><strong><u><em>This is for testing purpose!!!<img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smug.png" alt="" /><br />\r\n</em></u></strong></span></p>'),
(8, 1437, '<p>I am a graduate student at the London School of Economics. My service is as a private tutor. I <strong>answer questions</strong> and help you to <strong>clarify concepts</strong> you might be having trouble with.</p> <p>I send you detailed explanations in a pdf file so that you can understand and incorporate the reasoning in solving economics problems. We can then discuss the exercises via chat to clear up any issues you may have.</p> <p><span style="color: rgb(0, 102, 0);"><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees">Degrees</span></strong></span><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><br /> BSc in Mathematics. Diploma in Business Intelligence.</span></p> <p><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><span style="color: rgb(0, 102, 0);">Experience and Qualific</span><br /> </span></strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblExperience">Two    year''s   experience as a private tutor in Economics. University   Professor  in  Relational Databases and Business Intelligence.  21 years    professional  experience in Information Technology (IT).</span><strong><span id="ctl00_ctl00_AbsMP_BaseMP_lblDegrees"><br /> </span></strong></p>'),
(10, 0, '<p><span style="color: rgb(255, 102, 0);"><strong>Am here to do something!!!&nbsp;&nbsp; test<br />\r\n</strong></span></p>'),
(9, 124, '<p>I have a PhD in pure awesomeness. Don''t resist.</p>'),
(11, 0, '<p><span style="color: rgb(255, 102, 0);"><strong>Am here to do something!!!&nbsp;&nbsp; tesxt here<br />\r\n</strong></span></p>'),
(12, 1471, '<p>blah</p>'),
(13, 1660, '<p><strong>Success travels from failure to failure with enthusiasm.</strong> <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smile.png" alt="" /></p>'),
(14, 1662, '<p>Hi, guys, are you stressed out about math133? Do you find it hard to solve financial math problems? Don''t worry, I''m here to help you.&nbsp; </p>'),
(15, 1628, '<p>My name is Chris and I am a 2nd year Rotman Commerce student in Finance &amp; Economics. I love calculus and I would love to be able to share my knowledge and tips for succeeding in MAT133 with you.</p><p>I look forward to answering your questions!&nbsp;If I''m online, connect with me! If not, then please feel free to send me a private message for my personal contact info or for any other questions/concerns you may have and I will get back to you asap!</p><div><br />&nbsp;</div>'),
(16, 1679, '<p>I have 7 years of tutoring experience, and 2 years of TA experience. In my spare time I work as a private tutor for highschool students and first or second year engineering students.</p><p>I have completed my undergraduate degree in Engineering and any core course I can certainly cover with you.</p><p>Because I have done my undergrad at 1 university, and am now doing my MSc in Engineering (where I TA) at another I have a great undestanding for the variability (or lack there of) between schools and professors.</p><p>Any Math course up to the end of 2nd year I can cover, as well as any core engineering course (sciences required included), and ANY highschool science (Biology, Chemistry and Physics) or math course.</p>'),
(17, 1626, '<p>&nbsp;HELLO!</p> <p>Call me Sam. &nbsp;I will be working with students mostly in the Algebra 1 and Geometry range as that is what I will be teaching on the online learninghighschool. &nbsp;I will be adding algebra 2, but fro any questions with algebra 1, just send me a quick message and we will work it out! &nbsp;Hope your rayku experience is wonderful!</p> <p>Sam</p>'),
(18, 1623, '<p>&nbsp;HI, I AM STUDYING MATHEMATICS, ECONOMICS AND STATISTICS IN U OF T. AND THIS IS MY FOURTH YEAR. I HAVE TAKEN MAT 137, MAT 244, MAT 246, MAT 315 AND SOME STATISCS COURSES. I AM HAPPY TO ANSWER ALL THE RELATED QUESTIONS.</p>'),
(19, 1656, '<p>&nbsp;I am a new tutor at Rayku. I am a second year student in University of Toronto. I did very well in my first year Calculus, MAT 133. If you have any question related to my field, feel free to ask. I am right there!</p>'),
(20, 1632, '<p>I''m like your usual tutor (4.0 gpa, 90 or above in every course, etc) except my career goal isn''t something fancy like doctor or lawyer. Rather, I want to be a teacher and I have the experience and skill to back that up. It''s important that you choose a tutor who knows what he''s talking about, but it''s even better when you know what he''s talking about too. I think I have both those qualities. So choose me!</p><p>&nbsp;<img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wavespin.gif" alt="" /></p>'),
(21, 1697, '<p>I''m Da Best!&nbsp;</p>'),
(22, 1659, '<p>Hey guys, I am an eco and maths student. I&nbsp;love what I&nbsp;am doing and learning, and I will use that to help you on the way of your studies and understanding. I am an epert on the MAT133 material (I&nbsp;got a 94) and I am presently doing MAT223 and MAT235, both of which are going equally well. I&nbsp;am also doing ECO227, which is basically the equivalent of STA257 and STA261, so feel free to ask any questions there too. If you want to undderstand and not just enter numbers into the calculator, I''m your man!</p>'),
(23, 1620, '<p>&nbsp;I am an undergraduate student at the University of Waterloo studying Mathematics and Wilfrid Laurier University studying Business Administration. My service is as a private tutor. I answer math questions and help clarify concepts.</p><p>&nbsp;</p>');
