INSERT INTO `item` (`id`, `size_id`, `item_type_id`, `title`, `description`, `price_per_unit`, `shipping_charge_per_unit`, `actual_value`, `actual_value_currency`, `quantity`, `image`, `features`, `is_active`, `created_at`, `updated_at`) VALUES
(6, 1, 3, 'ToGenius G-Pen Ultra-Slim Tablet', 'Add a tablet to your computer, the G-Pen F610 from Genius enables a whole new world of functionality. You can use the 6"x10" tablet for drawing and editing images. There are 1024 levels of pressure that can be detected for shape and line thickness control. You can also use the pad to make hand written notes in documents, sign emails or quickly draw charts.\r\n\r\nThe border of the 2,000 line per inch tablet has 29 macro keys so you can keep your hands on the pen while working. There are sections for Office and Internet, and Editing. The working area will work with any sized screen for very precise drawing or sketching. ', 105, 5, 105, 'CAD', 3, '2f2b5ca90fbbff3e981e01cf9648100f.png', '2000 lpi Resolution, USB Interface, 10" x 6.25", 1024 pressure levels', 1, '2009-11-09 01:58:00', '2010-11-23 07:28:00'),
(8, 4, 4, '$50 Amazon.com Gift Card', 'Amazon.com Gift Cards are the perfect way to give anyone exactly what they''re hoping for - even if you don''t know what it is. Amazon.com Gift Cards are redeemable for millions of items across Amazon.com and are also now redeemable at Endless.com.', 50, 0, 50, 'USD', 1, 'b0a0d2aa50fee99b454dc71b60636ae0.png', 'never expire, no extra fees, emailed within 2 days', 1, '2010-04-05 19:13:00', '2011-01-09 03:09:38'),
(9, 4, 4, '$50CAD via PayPal', 'Convert your Rayku Points into cash. Paypal allows you to purchase virtually anything, virtually any where online. PayPal operates in 190 markets, and it manages more than 228 million accounts, more than 73 million of them active. PayPal allows customers to send, receive, and hold funds in 19 currencies worldwide.', 50, 0, 50, 'CAD', 10, '5294445a5641ed6cee751fbb4d3d9372.png', 'Direct deposit, no limits', 1, '2010-11-11 22:25:00', '2011-08-23 06:58:47'),
(13, 5, 1, 'University of Toronto UNISEX ZIP Hoodie', 'University of Toronto grey Unisex Zip hoodie that is warm and cozie for fall, winter, and spring. Made with 80 percent cotton and 20 percent polyester. Has University of Toronto on front chest along with the year 1827. Perfect as a gift or to wear yourself on campus and off.', 39, 2, 39, 'CAD', 19, 'e37394527b17f6c4db0b6c11a79420c3.jpg', 'logo, cotton, polyester, warm', 1, '2010-11-23 08:08:00', '2011-10-08 13:48:46'),
(14, 2, 3, 'Apple 2GB 5th Gen iPod Shuffle ', 'Smaller than its second generation incarnation, the latest model of the iPod Shuffle amalgamates all of the great features you loved, and eliminated the ones you don''t. It now offers the easy to use buttons to control what you''re listening to without having to look down at what you''re doing. It also allows you to build and load playlists, or let the Genius function do it for you. The larger battery life lets you listen to 15 hours of music - longer than the average jog or workout. And, with a simple rear clip, you can wear in anywhere.', 59, 5, 59, 'CAD', 2, '307dc0c6695bf6f2198b7b29bb1b0494.jpg', 'long battery life, small, durable, Apple', 1, '2010-11-23 08:14:00', '2010-11-23 07:27:00'),
(15, 1, 3, 'Apple 8GB iPod Touch ', 'The 8GB hard drive lets you store 1,750 songs or 10 hours of video to bring with you where ever you go. That''s a lot of content. Speaking of which, the Touch now has full access to the App Store where you can shop for and download games and applications to your heart''s content - many of them free! And with the iPod Touch''s one-of-kind accelerometer, Multi-Touch display and 3D graphics, gaming just got a whole lot more fun. ', 249, 5, 249, 'CAD', 2, 'f77868cf2946e0ee7a0b88327d5ef291.jpg', 'touch screen, MANY apps, games, work', 1, '2010-11-23 08:18:00', '2011-01-09 03:10:22'),
(16, 1, 5, '2x3 WhiteyBoard Stick-On Whiteboard', 'Our team of chemists formulated an ultra-light, ultra-inexpensive whiteboard sticker that can adhere to any flat surface in just seconds and comes off clean - no installation, no heavy lifting, and no breaking the bank. Our transferrable stickers are ideal for any room in the house, classroom, commercial building, or office in need of a quick functional or decorative fix while simultaneously outfitting users with an accessible surface for doodling notes and ideas.', 15, 5, 15, 'USD', 19, 'f5d291ba353da77e7c5ad3bec9bd5448.jpg', 'easy removal, custom shapes, green product, new', 0, '2010-11-23 07:42:00', '2011-01-26 22:53:00'),
(17, 2, 4, '1 Month (any month) TTC Metro Pass', 'You can buy a Metropass for unlimited (Extra fare required for Downtown Express routes or contracted routes operated by the TTC outside the City of Toronto.) travel in a specific month on all regular TTC services\r\n\r\nThe TTC Metropass is transferable, however the pass can only be transferred after a person using it has exited the TTC transit system. No "Pass Back" allowed. Penalty for misuse.\r\n\r\nAdult: No Photo ID is required. You can lend your transferable Metropass to family or friends when you are not travelling with it. ', 99, 2, 99, 'CAD', 4, 'f35e7fc9374d68a2f3e3f5193f5af5d3.jpg', 'any month, unlimited use, travel GTA, subway bus streetcar', 1, '2010-11-23 07:51:00', '2011-10-24 02:53:28'),
(18, 4, 4, '$100CAD via PayPal', 'Convert your Rayku Points into cash. Paypal allows you to purchase virtually anything, virtually any where online. PayPal operates in 190 markets, and it manages more than 228 million accounts, more than 73 million of them active. PayPal allows customers to send, receive, and hold funds in 19 currencies worldwide.', 100, 0, 100, 'CAD', 1, '43a3c358c9962d6221cbd1e73688629c.jpg', 'Direct deposit, no limits', 1, '2011-02-13 09:49:00', '2011-02-13 09:49:00'),
(19, 4, 4, '$35CAD via PayPal', 'Convert your Rayku Points into cash. Paypal allows you to purchase virtually anything, virtually any where online. PayPal operates in 190 markets, and it manages more than 228 million accounts, more than 73 million of them active. PayPal allows customers to send, receive, and hold funds in 19 currencies worldwide.', 35, 0, 35, 'CAD', 1, 'df9e82ac94d2ec2924d16a20cbffc32e.jpg', 'Direct deposit, no limits', 1, '2011-02-13 09:52:00', '2011-08-29 01:06:07');
