(121, 454, 'Testing New For Limit', '<p><strong><em>&ldquo;All our dreams can come true,&nbsp; if we have the courage to pursue them.&rdquo;</em></strong></p>\r\n<p><strong><em>&ldquo;Death is not the greatest loss in life. The greatest loss is what dies inside us while we live.&rdquo;</em></strong></p>\r\n<p><strong><em>&ldquo;Common sense is the knack of seeing things as they are, and doing things as they ought to be done . &rdquo;</em></strong></p>\r\n<p><strong><em>&ldquo;I don&rsquo;t think of all the misery but of the beauty that still remains.&rdquo;</em></strong></p>\r\n<p><strong><em><strong>&ldquo;The actions of men are the best interpreters of their thoughts&rdquo;</strong><br />\r\n</em></strong></p>\r\n<p><strong><em><strong>&ldquo;There is not a more pleasing exercise of the mind than gratitude. It is accompanied with such an inward satisfaction that the duty is sufficiently rewarded by the performance.&rdquo;</strong></em></strong></p>', '2010-07-31 01:50:01', 0),
