(258, 1453, 114, '2011-02-11 09:33:41', '2011-02-11 09:33:41', '<p>But I don''t seem to&nbsp;be able to find pages like the questions on Yahoo Answers, except for those ones in the forums. So that''s how things work here?</p>', 0, 0, NULL, 0, NULL),
(259, 1471, 114, '2011-02-12 18:15:47', '2011-02-12 18:15:47', '<p>Rayku has a fall back option that''s similar to Yahoo Answers. The forum/boards (this) has similar functions to a traditional question &amp; answer site like Yahoo Answers. It''s just organized in a forum style because we aren''t big enough to allow enough content to be hidden. This way, everything is laid out in the open and, in theory, questions get answered quicker.</p>\r\n<p>So yup, this is how it works here.</p>\r\n<p>Donny</p>', 0, 0, NULL, 0, NULL),
