(459, 1442, 205, '2011-10-06 23:59:35', '2011-10-07 00:00:36', '<p>Greetings Rayku tutors,</p><p class="MsoNormal"><o:p></o:p></p><p class="MsoNormal">Welcome to the exclusive beta opening of Rayku! Our staff have been working diligently to create the best learning environment for tutors and students. Just to break the ice, my name is Tristan. I&rsquo;m currently acting as the community administrator. My job is to ensure all of you have a productive and enjoyable time here at Rayku. As of now we are only allowing tutors to access the site, this means that activity may be a bit slower than usual. We urge all tutors to use this time to become accustomed to Rayku&rsquo;s features and mingle with each other. If you have any questions or concerns, do not hesitate to private message me.<o:p></o:p></p><p class="MsoNormal">Regards,<br />Tristan<o:p></o:p></p>', 0, 0, NULL, 0, NULL),
