(460, 1442, 206, '2011-10-07 00:02:31', '2011-10-07 00:02:31', '<p>Greetings Rayku Tutors,</p><p class="MsoNormal"><o:p></o:p></p><p class="MsoNormal">&nbsp; &nbsp; &nbsp;Welcome to the exclusive beta opening of Rayku! Our staff have been working diligently to create the best learning environment for the tutors and students. Just to break the ice, my name is Tristan. I&rsquo;m currently acting as the community administrator. My job is to ensure all of you have a productive and enjoyable time here at Rayku. As of now we are only allowing tutors to access the site, this means that activity may be a bit slower than usual. We urge all tutors to use this time to become accustomed to Rayku&rsquo;s features and mingle with each other. If you have any questions or concerns, do not hesitate to private message me.<o:p></o:p></p><p class="MsoNormal">Regards,<br />Tristan<o:p></o:p></p>', 0, 0, NULL, 0, NULL),
(461, 1442, 207, '2011-10-07 00:02:31', '2011-10-07 17:04:26', '<p class="MsoNormal">Hey there, Welcome to the exclusive beta opening of Rayku!</p><p class="MsoNormal">Our staff have been working diligently to create the best learning environment for the tutors and students. Just to break the ice, my name is Tristan. I&rsquo;m currently acting as the community administrator. My job is to ensure all of you have a productive and enjoyable time here at Rayku. As of now we are only allowing tutors to access the site, this means that activity may be a bit slower than usual. We urge all tutors to use this time to become accustomed to Rayku&rsquo;s features and mingle with each other. If you have any questions or concerns, do not hesitate to private message me.<o:p></o:p></p><p class="MsoNormal">Regards,<br />Tristan<o:p></o:p></p>', 0, 0, NULL, 0, NULL),
(462, 1471, 208, '2011-10-07 17:07:45', '2011-10-07 17:07:45', '<p>I''m gonna guess that most of you guys are also from UofT. But would be interesting to see where you''re all based out of.</p>', 0, 0, NULL, 0, NULL),
