(464, 1636, 209, '2011-10-09 17:16:57', '2011-10-09 17:16:57', '<p>&nbsp;Hello all,</p><p>&nbsp;</p><p>I\\''m a 2nd year Engineering Science student at UofT and I look forward to answering your questions.</p><p>&nbsp;</p><p>Regards,</p><p>nrootn</p>', 0, 0, NULL, 0, NULL),
(465, 1619, 209, '2011-10-09 17:38:21', '2011-10-09 17:38:21', '<p>Great to have you here - welcome to Rayku!!</p>', 0, 0, '24.246.86.78', 0, NULL),
(466, 1619, 210, '2011-10-09 17:48:28', '2011-10-09 17:48:28', '<p>Hey guys,</p><p>First of all, welcome to&nbsp;the Rayku beta! You''re the first to be able to take a peak inside, and we''re glad to have you here.</p><p>Please take some time now to try out the website, introduce yourself, and get to know one another.</p><p>In the coming weeks, we will be accepting a limited amount of invite-only students who would come onto the site to ask math-related questions. This will be a mix of first-year university students, and high school students.</p><p>Good luck! If you haven''t already, make sure to try out the whiteboard application by yourself at:<br /><a href="http://whiteboard.rayku.com">http://whiteboard.rayku.com</a></p><p>We''ll be sending you more stuff over email (i.e. training package) over the coming weeks to help you with getting prepared.<br />&nbsp;</p><p>If you have any questions or suggestions, post them in this forum.</p><p>Thanks!<br />Donny</p>', 0, 0, NULL, 0, NULL),
(467, 1442, 209, '2011-10-09 17:48:55', '2011-10-09 17:48:55', '<p>&nbsp;Welcome to the forum! Wow, I heard engineering is quite a rigorous program. &nbsp;At least now you can give a hand to some of those first year engineering students.</p>', 0, 0, '208.69.57.184', 0, NULL),
(468, 1636, 209, '2011-10-09 18:39:16', '2011-10-09 18:39:16', '<p>&nbsp;Thanks!</p>', 0, 0, '142.1.241.186', 0, NULL),
(469, 1660, 211, '2011-10-09 18:45:19', '2011-10-09 18:45:19', '<p>Hey guys.</p><p>I''m a 2nd year Computer Science Specialist Co-op with Math major and Stats minor student at University of Toronto Scarborough! I pretty much love math and how it helps math literate people from all over the world to share their knowledge on various topics. <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/smug.png" alt="" /></p><p>Also, I love writing poems whenever time permits on real-life events. <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/wink.png" alt="" /></p><p>I look forward to help people in math and answer their questions with clarity and enhanced readability.</p><p>Also, if you ask me &quot;Where do I&nbsp;come from?&quot;, my reply will be as simple as possible - &quot;UTSC&quot; <img src="http://www.rayku.com/js/fckeditor/editor/images/smiley/msn/happy.png" alt="" /></p><p>Kanwar</p>', 0, 0, NULL, 0, NULL),
(470, 1660, 208, '2011-10-09 18:47:55', '2011-10-09 18:47:55', '<p>Well I''m from UTSC :)</p>', 0, 0, '207.164.79.57', 0, NULL),
