(474, 1645, 212, '2011-10-09 22:17:46', '2011-10-09 22:17:46', '<p>Hey everyone, nice to know you.&nbsp; It''s Susan and I am a recent graduate from UTM. I specialize in Biology and minor in Chemistry. I am interested in insect biology and animal behavior. I like watching Japanese cartoon and playing computer games. Looking forward to meeting students and the whiteboard application is so cool!</p><p>Cheers,</p><p>Susan </p>', 0, 0, NULL, 0, NULL),
