(507, 1646, 232, '2011-10-10 21:41:31', '2011-10-10 21:41:31', '<p>&nbsp;Hey everyone. I''m a new tutor part of Rayku for MAT133 and I guess whatever else they plan to offer!</p><p>I''m 2nd year U of T studying finance and it''s nice to meet you all :).</p><p>Can''t wait til Rayku officially launches</p>', 0, 0, NULL, 0, NULL),
(508, 1626, 233, '2011-10-10 21:55:19', '2011-10-10 21:55:19', '<p>&nbsp;Hello!</p> <p>My name is Samuel and I am a tutor for rayku. &nbsp;I will be working on students with high school algebra 1 and geometry, soon I will be working on algbra 2, but I am preping my work for that. &nbsp;I am running a small online high school called thelearninghighschool, and will be growing that as time goes on. &nbsp;Nice to meet all of you!</p>', 0, 0, NULL, 0, NULL),
