(510, 1679, 234, '2011-10-11 03:33:08', '2011-10-11 03:33:08', '<p>Hey,</p><p>&nbsp;</p><p>The certification &quot;submit&quot; button is not working for me. Will this be activated in the near future?</p><p>&nbsp;</p><p>Thanks,</p><p>Alyssa</p>', 0, 0, NULL, 0, NULL),
(511, 1623, 235, '2011-10-11 12:18:35', '2011-10-11 12:18:35', '<p>&nbsp;HI, EVERYONE, MY NAME IS SHAN LIN. I AM GRAD TO BE A TUTOR ON RAYKU. I AM GOOD AT DIFFERENCIATION AND CALCULUS. I AM HAPPY TO ANSWER ALL THE MATH QUESTIONS THAT I KNOW.</p>', 0, 0, NULL, 0, NULL),
(512, 1623, 236, '2011-10-11 12:36:34', '2011-10-11 12:36:34', '<p>FOURTH YEAR IN UNIVERSITY OF TORONTO, STUDY MATHEMATICS AND ECNOMICS</p>', 0, 0, NULL, 0, NULL),
(513, 1643, 237, '2011-10-11 14:36:29', '2011-10-11 14:36:29', '<p>&nbsp;Hi everyone, I am from U of &nbsp;T Commerce and&nbsp;specialist&nbsp;in Finance and economics . I am currently in second year &nbsp;and took MAT 133 last year and did a great job on this course. Hope to help you with your math problem!!! thanks&nbsp;</p>', 0, 0, NULL, 0, NULL),
(514, 1631, 238, '2011-10-11 16:23:41', '2011-10-11 16:26:59', '<p>Hi guys, I''m a fourth year Mechanical Engineering student at the University of Toronto going into Masters of Applied Science next year. I have a strong academic background in undergraduate Mechanical Engineering courses and general mathematic/physics courses.</p><p>These are the relevant Mathematics courses I have taken at U of T as part of my undergraduate curriculum.</p><div>Mechanical Engineering Courses - University of Toronto</div><div>MAT186 Calculus 1 --&nbsp;(92%)</div><div>MAT188 Linear Algebra -- (89%)</div><div>MAT187 Calculus 2 -- (97%)</div><div>MIE230 Engineering Analysis -- (100%)</div><div>MIE231 Probability and Statistics for Engineers -- (85%)</div><div>MAT234 Differential Equations -- (92%)</div><div>MIE334 Numerical Methods -- (86%)</div><p>I am also able to help with any physics courses that you may be taking.</p><p>Hope to contribute as much as I can, Thanks!</p><p>&nbsp;</p><p>- Shahed</p>', 0, 0, NULL, 0, NULL),
(515, 1693, 239, '2011-10-11 22:28:33', '2011-10-11 22:28:33', '<p>My name is Vince. People from u of t know that the textbook used in first year calculus has a violin on it. so I use&nbsp;the&nbsp;name-violinsong&nbsp;on this platform.</p>', 0, 0, NULL, 0, NULL),
(516, 1693, 240, '2011-10-11 22:29:44', '2011-10-11 22:29:44', '<p>My name is Vince. People from u of t know that the textbook used in first year calculus has a violin on it. so I use the name-violinsong on this platform.</p>', 0, 0, NULL, 0, NULL),
