(540, 1632, 249, '2011-10-19 19:59:01', '2011-10-19 19:59:01', '<p>Hi, I''m a second year in the Economics and Math Specialist.</p><p>I''m taking MAT257 right now (though don''t ask me for help with that).</p><p>I''ll be able to tutor any first year math and economics.</p><p>Hope to be of service,</p><p>SImon</p>', 0, 0, NULL, 0, NULL),
(542, 1684, 251, '2011-10-21 08:29:54', '2011-10-21 08:29:54', '<p>I\\''m a 3rd year Mathematics Specialist Student at UofT, so I can help you guys out in many different areas! Feel free to get in touch with me!</p>\r\n<p>MATH&nbsp;IS&nbsp;AWESOME!&nbsp;:)</p>', 0, 0, NULL, 0, NULL),
(543, 1649, 252, '2011-10-23 23:13:32', '2011-10-23 23:13:32', '<p>Hi,&nbsp;I am Summer from University of Toronto. I am a second year student in Rotman Commerce &nbsp;and specialist in Finance and Economics. I took MAT133 in the first year and get 4.0 on this course. I am sure that&nbsp;I can help you guys on the relavant 133 topics.</p><p>P.S. MAT133 is not hard as you think.....</p>', 0, 0, NULL, 0, NULL),
