(550, 1659, 256, '2011-11-24 20:55:34', '2011-11-24 20:55:34', '<p>So, presently I&nbsp;am a second year student at UofT doing a specialist in Economics and a major in mathematics. </p><p>The maths/maths related courses I&nbsp;have done/am doing right now are as follows:&nbsp;</p><p>MAT133, MAT235, MAT223 and ECO227(very similar to STA257 AND STA261). I am doing very well in all of these courses, so if you have a questions, just fire away, and I can guide you to the answer. </p>', 0, 0, NULL, 0, NULL),
(551, 1659, 257, '2011-11-25 00:38:37', '2011-11-25 00:38:37', '<p>Hey guys, I have just got my account. There has been quite a delay, I&nbsp;know. Anyway, my point is that I&nbsp;have not had a tutoring session yet, therefore I&nbsp;am curious how it works. Can someone please give a somewhat detalied response?&nbsp;</p><p>Specifically, how do we know if someone wants to be tutored by us one on one?&nbsp;Do we get like a pop up on the screen, a buzzing dound, or some kind of notification?&nbsp;</p><p>Any other details would also be welcome. </p><p>Cheers, </p><p>Bence </p>', 0, 0, NULL, 0, NULL),
(552, 1619, 257, '2011-11-27 18:06:44', '2011-11-27 18:06:44', '<p>Hey Bence,</p><p>Glad to have you here! As you probably know, Rayku is still very much in private beta. We are only allowing a limited amount of students on the site at once, which completely follows our development schedule and timeline. Until we open up the website more, there won''t be frequent questions.</p><p>Thanks,<br />Donny</p>', 0, 0, '142.157.4.136', 0, NULL),
